import React from "react";
import { useNavigate } from "react-router-dom";

const NavBar = () => {
  const navigate = useNavigate();
  return (
    <nav>
      <p>starseeker</p>
      <ul>
        <li>Favourite</li>
        <li onClick={() => navigate("/starseeker/cheap-travel")}>
          Cheap Travel
        </li>
        <li>Login/sign up</li>
      </ul>
    </nav>
  );
};

export default NavBar;
